import React from "react";
import Nav from "../componentes/nav";
import img from '../imgs/click.jpg'

const Inicio =()=>{
    return(
        <div className="bg-black h-[100vh] w-full">
            <Nav/>
            <div className="flex flex-row w-full h-full">
                <div className="w-full h-full flex flex-col items-center mt-[150px] text-white">
                    <h1 className="text-5xl mt-[80px]">Welcome to my web</h1>
                    <h1 className="text-3xl ml-14 mt-14">You can know about my profesional profile and also personal things that i have the pleasure to share.</h1>
                </div>
                <img className="h-[50%] w-[50%] mt-[250px] rounded-[30px] mr-[50px]" src={img} />
            
            </div>
        </div>
    )

}

export default Inicio;
